export default {
  setSorting(sorting) {
    return {
      type: 'SET_SORTING',
      sorting
    }
  },

  setPage(page) {
    return {
      type: 'SET_PAGE',
      page
    }
  },

  setSearchQuery(searchQuery) {
    return {
      type: 'SET_SEARCH_QUERY',
      searchQuery
    }
  }
}
